import Image from '../Beans.jpg';

function BlogPost(props) {
    return (
        <div>
            {/* <h1>Title: {props.Title}</h1> <br />
            Author: {props.Author} <br />
            {props.img} <br />
            {props.text} <br /> */}

            <img src={'../../blog_back/Images/Beans.webp'} alt='Beans' />
            <img src={'../Images/Beans.webp'} alt='Beans' />
            <img src={Image} alt='Beans' />
        </div>
    )
}

export default BlogPost;
